import { createRouter, createWebHistory } from 'vue-router'
import LoginView from '../views/Login.vue'
import AdminView from '../views/Admin.vue'

const routes = [
  {
    path: '/login',
    name: 'loginView',
    component: LoginView
  },
  {
    path: '/admin',
    name: 'admin',
    component: AdminView
  }
]

const router = createRouter({
  history: createWebHistory(),
  routes
})

export default router
